var title_f2_61_3037="Neuraminidase inhibitor dosing for flu prophylaxis in children";
var content_f2_61_3037=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F61888&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F61888&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dosing recommendations for neuraminidase inhibiting agents for prevention of influenza in children and adolescents*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug/formulation",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"5\">",
"        Dosing recommendations for prophylaxis",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        <p>",
"         <strong>",
"          Oseltamivir (Tamiflu",
"          <sup>",
"           &reg;",
"          </sup>",
"          )",
"         </strong>",
"         <sup>",
"          &Delta;",
"         </sup>",
"        </p>",
"        <p>",
"         30 mg capsule",
"        </p>",
"        <p>",
"         45 mg capsule",
"        </p>",
"        <p>",
"         75 mg capsule",
"        </p>",
"        <p>",
"         6 mg/mL suspension",
"         <sup>",
"          &loz;",
"         </sup>",
"        </p>",
"       </td>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        1 through 12 years",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        &ge;13 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &le;15 kg",
"       </td>",
"       <td>",
"        &gt;15-23 kg",
"       </td>",
"       <td>",
"        &gt;23-40 kg",
"       </td>",
"       <td>",
"        &gt;40 kg",
"       </td>",
"       <td rowspan=\"2\">",
"        75 mg once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        30 mg once daily",
"       </td>",
"       <td>",
"        45 mg once daily",
"       </td>",
"       <td>",
"        60 mg once daily",
"       </td>",
"       <td>",
"        75 mg once daily",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <p>",
"         <strong>",
"          Zanamivir",
"         </strong>",
"         <sup>",
"          &sect;",
"         </sup>",
"         <strong>",
"          (Relenza",
"          <strong>",
"           <sup>",
"            &reg;",
"           </sup>",
"          </strong>",
"          )",
"         </strong>",
"        </p>",
"        <p>",
"         5 mg per inhalation (Diskhaler)",
"        </p>",
"       </td>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Children &ge;5 years and adults",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"5\">",
"        2 inhalations (10 mg total per dose)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The choice of agent for prophylaxis depends upon the age of the patient and the susceptibility patterns of circulating strains (see text for details).",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      The duration of prophylaxis depends upon the clinical circumstances of the individual case. Please see text for details.",
"      <br>",
"       &Delta; Dose adjustment is necessary for patients with renal insufficiency. Oseltamivir doses for infants younger than one year of age are provided in the text.",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        Oral suspensions in the 12 mg/mL concentration will remain available until supplies run out. Providers should be aware that",
"        <strong>",
"         patients may receive either concentration (12 mg/mL or 6 mg/mL) from their pharmacy during the 2012-2013 season",
"        </strong>",
"        . When dispensing the oral suspension of oseltamivir, providers and pharmacists must take care to provide a dosing device that matches the units of measure on the prescription.",
"        <br>",
"         &sect; Zanamivir inhalation powder should not be reconstituted in any liquid formulation and is not recommended for use in nebulizers or mechanical ventilators.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      <ol>",
"       <li>",
"        American Academy of Pediatrics. Antiviral drugs. In: Red Book: 2012 Report of the Committee on Infectious Diseases, 29th ed, Pickering LK (Ed), American Academy of Pediatrics, Elk Grove Village, IL, 2012. p.841.",
"       </li>",
"       <li>",
"        www.fda.gov/Safety/MedWatch/SafetyInformation/SafetyAlertsforHumanMedicalProducts/ucm183714.htm (Accessed on June 28, 2012).",
"       </li>",
"       <li>",
"        www.fda.gov/Safety/MedWatch/SafetyInformation/SafetyAlertsforHumanMedicalProducts/ucm186081.htm (Accessed on June 28, 2012).",
"       </li>",
"       <li>",
"        www.fda.gov/Safety/MedWatch/SafetyInformation/SafetyAlertsforHumanMedicalProducts/ucm262432.htm (Accessed on June 28, 2012).",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
